import React from 'react'

export default function ActiveUsers(props){

    return(
        <div style={{position:"absolute",right:"0", padding:"2%"}} className='green lighten-3'>
            <h5>Active Users</h5>
            {props.users.map((user)=>{
                return(
                    <h6>{user}</h6>
                )
            })}
        </div>
    )
}
